import React, { useState } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import { searchBlogByTitleApi } from '../api/Api'; // Import the searchBlogByTitleApi function

const Navbar = () => {
  const user = JSON.parse(localStorage.getItem('user'));
  const navigate = useNavigate();
  const [searchQuery, setSearchQuery] = useState('');
  const [searchResults, setSearchResults] = useState([]);

  const handleLogout = (e) => {
    e.preventDefault();
    localStorage.clear();
    navigate('/login');
  };

  const handleSearch = async () => {
    try {
      if (!searchQuery.trim()) {
        return; // If search query is empty or only whitespace, do nothing
      }
      const response = await searchBlogByTitleApi(searchQuery);
      setSearchResults(response.blogs); // Update search results
    } catch (error) {
      console.error('Error searching blogs:', error);
    }
  };

  return (
    <>
      <nav className="navbar navbar-expand-lg navbar-light bg-white border-bottom" style={{ borderBottom: '1px solid rgba(0, 0, 0, 0.1)', padding: '18px 70px' }}>
        <div className="container-fluid">
          <div className="d-flex align-items-center">
            <Link className="navbar-brand" to="/">
              <img src="assets/images/logo2.png" alt="Logo" width="40" height="40" className="d-inline-block align-top" style={{ maxHeight: '50px', maxWidth: '100%' }} />
            </Link>
          </div>

          <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
            <span className="navbar-toggler-icon"></span>
          </button>

          <div className="collapse navbar-collapse" id="navbarSupportedContent">
            <form className="ms-auto d-flex align-items-center" role="search" onSubmit={(e) => { e.preventDefault(); handleSearch(); }}>
              <input
                type="text"
                className="form-control me-2"
                placeholder="Search blogs by title"
                value={searchQuery}
                onChange={(e) => setSearchQuery(e.target.value)}
              />
              <button className="btn btn-outline-secondary" type="submit">Search</button>
            </form>
            <div className="d-flex align-items-center">
              {user ? (
                <div className="dropdown">
                  <button className="btn btn-dark dropdown-toggle" type="button" data-bs-toggle="dropdown" aria-expanded="false" style={{ borderRadius: '35px' }}>
                    Welcome, {user.firstName}
                  </button>
                  <ul className="dropdown-menu">
                    <li><Link className="dropdown-item" to="/profile">Profile</Link></li>
                    <li><Link className="dropdown-item" to="/change-password">Change Password</Link></li>
                    {user.isAdmin && <li><Link className="dropdown-item" to="/admin">Admin Dashboard</Link></li>}
                    <li><button onClick={handleLogout} className="dropdown-item" to="/logout">Logout</button></li>
                  </ul>
                </div>
              ) : (
                <>
                  <Link className="btn btn-outline-dark me-2" to={'/login'} style={{ backgroundColor: 'black', color: 'white', borderRadius: '35px' }}>Login</Link>
                  <Link className="btn btn-outline-light" to={'/register'} style={{ backgroundColor: 'white', color: 'black', borderRadius: '35px' }}>Register</Link>
                </>
              )}
            </div>
          </div>
        </div>
      </nav>
      {searchResults.length > 0 && (
        <div className="container mt-2">
          <div className="row">
            {searchResults.map((blog) => (
              <div className="col-md-4 mb-4" key={blog._id}>
                <div className="card">
                  <div className="card-body">
                    <h5 className="card-title">{blog.title}</h5>
                    <p className="card-text">{blog.content}</p>
                    <Link to={`/blogs/${blog._id}`} className="btn btn-primary">Read More</Link>
                  </div>
                </div>
              </div>
            ))}
          </div>
        </div>
      )}
    </>
  );
};

export default Navbar;
